pragma solidity ^0.6.6;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

interface NFT721 {
    /**
     * @dev Emitted when `tokenId` token is transferred from `from` to `to`.
     */
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);

    /**
     * @dev Emitted when `owner` enables `approved` to manage the `tokenId` token.
     */
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);

    /**
     * @dev Emitted when `owner` enables or disables (`approved`) `operator` to manage all of its assets.
     */
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);

    /**
     * @dev Returns the number of tokens in ``owner``'s account.
     */
    function balanceOf(address owner) external view returns (uint256 balance);

    function tokenOfOwnerByIndex(address owner, uint256 index) external view returns (uint256);

    /**
     * @dev Returns the owner of the `tokenId` token.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function ownerOf(uint256 tokenId) external view returns (address owner);

    /**
     * @dev Safely transfers `tokenId` token from `from` to `to`, checking first that contract recipients
     * are aware of the ERC721 protocol to prevent tokens from being forever locked.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `tokenId` token must exist and be owned by `from`.
     * - If the caller is not `from`, it must be have been allowed to move this token by either {approve} or {setApprovalForAll}.
     * - If `to` refers to a smart contract, it must implement {NFT721Receiver-onERC721Received}, which is called upon a safe transfer.
     *
     * Emits a {Transfer} event.
     */
    function safeTransferFrom(address from, address to, uint256 tokenId) external;

    /**
     * @dev Transfers `tokenId` token from `from` to `to`.
     *
     * WARNING: Usage of this method is discouraged, use {safeTransferFrom} whenever possible.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `tokenId` token must be owned by `from`.
     * - If the caller is not `from`, it must be approved to move this token by either {approve} or {setApprovalForAll}.
     *
     * Emits a {Transfer} event.
     */
    function transferFrom(address from, address to, uint256 tokenId) external;

    /**
     * @dev Gives permission to `to` to transfer `tokenId` token to another account.
     * The approval is cleared when the token is transferred.
     *
     * Only a single account can be approved at a time, so approving the zero address clears previous approvals.
     *
     * Requirements:
     *
     * - The caller must own the token or be an approved operator.
     * - `tokenId` must exist.
     *
     * Emits an {Approval} event.
     */
    function approve(address to, uint256 tokenId) external;

    /**
     * @dev Returns the account approved for `tokenId` token.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function getApproved(uint256 tokenId) external view returns (address operator);

    /**
     * @dev Approve or remove `operator` as an operator for the caller.
     * Operators can call {transferFrom} or {safeTransferFrom} for any token owned by the caller.
     *
     * Requirements:
     *
     * - The `operator` cannot be the caller.
     *
     * Emits an {ApprovalForAll} event.
     */
    function setApprovalForAll(address operator, bool _approved) external;

    /**
     * @dev Returns if the `operator` is allowed to manage all of the assets of `owner`.
     *
     * See {setApprovalForAll}
     */
    function isApprovedForAll(address owner, address operator) external view returns (bool);

    /**
      * @dev Safely transfers `tokenId` token from `from` to `to`.
      *
      * Requirements:
      *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
      * - `tokenId` token must exist and be owned by `from`.
      * - If the caller is not `from`, it must be approved to move this token by either {approve} or {setApprovalForAll}.
      * - If `to` refers to a smart contract, it must implement {NFT721Receiver-onERC721Received}, which is called upon a safe transfer.
      *
      * Emits a {Transfer} event.
      */
    function safeTransferFrom(address from, address to, uint256 tokenId, bytes calldata data) external;

}

contract IntensityChangeToken is ERC20 {
    using SafeMath for uint256;

    address public admin;

    mapping(address => uint) balances;

    mapping(uint => uint) public birthOfNFT;

    address private LedNFTAdderess;
    mapping(uint => uint) public lastClaimedNFTIdToTimeMapping;
    mapping(uint => uint) public lastClaimedNFTIdToAgeMapping;

    event ClaimEvent(address indexed claimedAddress, uint claimAmount);
    /**
     * Constructor function
     * Initializes contract with the creator of the contract
     */
    constructor() public ERC20("IntensityChangeToken", "ICT") {
        admin = msg.sender;
    }

    function setBirthOfNFT(uint _tokenId, uint _time) external {

        //These checks will avoid anyone to call this method explicitly
        require(msg.sender == LedNFTAdderess, "Only LedNFT contract can set birth of NFT");

        birthOfNFT[_tokenId] = _time;
    }

     /**
     * @dev Claim minted ICTs
     */
    function claim() external returns (uint256) {
        require(LedNFTAdderess != address(0), "NFT address was not set during deployment of the contract");
        uint totalTokensOfOwner = NFT721(LedNFTAdderess).balanceOf(msg.sender);

        uint256 totalClaimQty = 0;
        for (uint i = 0; i < totalTokensOfOwner; i++) {

            uint tokenId =  NFT721(LedNFTAdderess).tokenOfOwnerByIndex(msg.sender, i); 
            require(NFT721(LedNFTAdderess).ownerOf(tokenId) == msg.sender, "Sender is not the owner");

            uint256 claimQty = accumulated(tokenId);
            if (claimQty != 0) {
                totalClaimQty = totalClaimQty.add(claimQty);
            }
            lastClaimedNFTIdToTimeMapping[tokenId] = block.timestamp;
        }
        require(totalClaimQty != 0, "No accumulated ICT");
        _mint(msg.sender, totalClaimQty); 
        emit ClaimEvent(msg.sender, totalClaimQty);
        return totalClaimQty;
    }


     /**
     * @dev It is set right after deployment.
     */
    function setLedNFTAddress(address _nftAddress) external {
        require(LedNFTAdderess == address(0), "Already set");
        require(msg.sender == admin, "Not authorised");

        LedNFTAdderess = _nftAddress;
    }


    //accumulated ICT token for a particular tokenId
    function accumulated(uint _tokenId) private returns (uint256) {
        require(birthOfNFT[_tokenId] > 0, "NFT is not minted yet for the supplied tokenID");

        uint ageOfNFT = (block.timestamp).sub(birthOfNFT[_tokenId]);
        uint previousClaimAge = lastClaimedNFTIdToAgeMapping[_tokenId] > 0 ? lastClaimedNFTIdToAgeMapping[_tokenId] : 0;

        require(previousClaimAge <= 400, "All ICT are exhauseted for this NFT");

        if(ageOfNFT >= 400) {
            ageOfNFT = 400;
        }

        uint claimedAmount;
        uint mod;
        if(ageOfNFT <= 100) {
            claimedAmount = ((ageOfNFT - previousClaimAge)/10)*8;
            mod = ageOfNFT%10;
        } else if(ageOfNFT <= 200) {

            if(previousClaimAge < 100) {
                if((100 - previousClaimAge)%10 != 0) {
                    claimedAmount = ((100 - previousClaimAge)/10)*8 + 8 + ((ageOfNFT - 100)/10)*4;
                } else {
                    claimedAmount = ((100 - previousClaimAge)/10)*8 + ((ageOfNFT - 100)/10)*4;
                }
            } else {
                claimedAmount = ((ageOfNFT - previousClaimAge)/10)*4;
            }
            mod = ageOfNFT%10;

        } else if(ageOfNFT <= 300) {

            if(previousClaimAge < 100) {
                if((100 - previousClaimAge)%10 != 0) {
                    claimedAmount = ((100 - previousClaimAge)/10)*8 + 8 + 40 + ((ageOfNFT - 200)/10)*2;
                } else {
                    claimedAmount = ((100 - previousClaimAge)/10)*8 + 40 + ((ageOfNFT - 200)/10)*2;
                }
            } else  if(previousClaimAge < 200) {
                if((200 - previousClaimAge)%10 != 0) {
                    claimedAmount = ((200 - previousClaimAge)/10)*4 + 4 + ((ageOfNFT - 200)/10)*2;
                } else {
                    claimedAmount = ((200 - previousClaimAge)/10)*4 + ((ageOfNFT - 200)/10)*2;
                }
            } else {
                claimedAmount = ((ageOfNFT - previousClaimAge)/10)*2;
            }
            mod = ageOfNFT%10;

        } else {

             if(previousClaimAge < 100) {
                if((100 - previousClaimAge)%10 != 0) {
                    claimedAmount = ((100 - previousClaimAge)/10)*8 + 8 + 40 + 20 + ((ageOfNFT - 300)/10);
                } else {
                    claimedAmount = ((100 - previousClaimAge)/10)*8 + 40 + 20 + ((ageOfNFT - 300)/10);
                }
            } else  if(previousClaimAge < 200) {
                if((200 - previousClaimAge)%10 != 0) {
                    claimedAmount = ((200 - previousClaimAge)/10)*4 + 4 + 20 + ((ageOfNFT - 300)/10);
                } else {
                    claimedAmount = ((200 - previousClaimAge)/10)*4 + 20 + ((ageOfNFT - 300)/10);
                }
             } else  if(previousClaimAge < 300) {
                if((300 - previousClaimAge)%10 != 0) {
                    claimedAmount = ((300 - previousClaimAge)/10)*2 + 2 + ((ageOfNFT - 300)/10);
                } else {
                    claimedAmount = ((300 - previousClaimAge)/10)*2 + ((ageOfNFT - 300)/10);
                }
            } else {
                claimedAmount = (ageOfNFT - previousClaimAge)/10;
            }
            mod = ageOfNFT%10;
        }

        lastClaimedNFTIdToAgeMapping[_tokenId] = ageOfNFT - mod;
        return claimedAmount * 10**18;

    }


    //Approve the ICT: so that LED NFT contract can send those ICT on behalf of User while executing ChangeBlinkPattern
    function approve(address owner, address spender, uint256 amount) public returns (bool) {
        _approve(owner, spender, amount);
        return true;
    }

}

